import { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../assets/css/login.css";

interface RegisterValues {
  name: string;
  email: string;
  password: string;
  confirmPassword: string;
}

const Register = () => {
  const [formValues, setFormValues] = useState<RegisterValues>({
    name: "",
    email: "",
    password: "",
    confirmPassword: "",
  });
  const [errors, setErrors] = useState<{ [key: string]: string }>({});
  const [success, setSuccess] = useState(false);

  const navigate = useNavigate();

  const validateForm = () => {
    const newErrors: { [key: string]: string } = {};
    if (!formValues.name) newErrors.name = "Name is required";
    if (!formValues.email) newErrors.email = "Email is required";
    if (!formValues.password) newErrors.password = "Password is required";
    if (formValues.password.length > 0 && formValues.password.length < 6)
      newErrors.password = "Password must be at least 6 characters";
    if (formValues.confirmPassword !== formValues.password)
      newErrors.confirmPassword = "Passwords do not match";
    return newErrors;
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setFormValues({
      ...formValues,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    const formErrors = validateForm();
    if (Object.keys(formErrors).length > 0) {
      setErrors(formErrors);
      return;
    }
    setErrors({});
    // H채r skickar du data till backend, men vi visar bara success
    setSuccess(true);
    setTimeout(() => {
      navigate("/"); // G책 tillbaka till login efter 1.2s
    }, 1200);
  };

  return (
    <div className="login-wrapper">
      <div className="login-form-container">
        <div className="login-form-title">Register new account</div>
        <form className="login-form" onSubmit={handleSubmit} autoComplete="off">
          <div className="form-group">
            <label htmlFor="name" className="form-label">
              name
            </label>
            <input
              type="text"
              className="form-control"
              id="name"
              name="name"
              value={formValues.name}
              onChange={handleChange}
              autoFocus
            />
            {errors.name && <small className="text-danger">{errors.name}</small>}
          </div>
          <div className="form-group">
            <label htmlFor="email" className="form-label">
              email address
            </label>
            <input
              type="email"
              className="form-control"
              id="email"
              name="email"
              value={formValues.email}
              onChange={handleChange}
            />
            {errors.email && <small className="text-danger">{errors.email}</small>}
          </div>
          <div className="form-group">
            <label htmlFor="password" className="form-label">
              password
            </label>
            <input
              type="password"
              className="form-control"
              id="password"
              name="password"
              value={formValues.password}
              onChange={handleChange}
            />
            {errors.password && (
              <small className="text-danger">{errors.password}</small>
            )}
          </div>
          <div className="form-group">
            <label htmlFor="confirmPassword" className="form-label">
              confirm password
            </label>
            <input
              type="password"
              className="form-control"
              id="confirmPassword"
              name="confirmPassword"
              value={formValues.confirmPassword}
              onChange={handleChange}
            />
            {errors.confirmPassword && (
              <small className="text-danger">{errors.confirmPassword}</small>
            )}
          </div>
          <button type="submit">Register</button>
        </form>
        <button
          type="button"
          className="register-link"
          onClick={() => navigate("/")}
          style={{ marginTop: "0.7rem" }}
        >
          Already have an account? Login
        </button>
        {success && (
          <div style={{ color: "#45a473", textAlign: "center", marginTop: "1.2rem" }}>
            Registration successful! Redirecting...
          </div>
        )}
      </div>
    </div>
  );
};

export default Register;
